query AllArtistsTestsQuery {
  show(id: "anderson-fine-art-gallery-flickinger-collection") {
    ...AllArtists_show
    __id
  }
}

fragment AllArtists_show on Show {
  artists_grouped_by_name {
    letter
    items {
      ...ArtistListItem_artist
      __id
    }
  }
  __id
}

fragment ArtistListItem_artist on Artist {
  id
  __id
  name
  is_followed
  nationality
  birthday
  deathday
  image {
    url
  }
}
